import EventCard from "../components/EventCard";
import { useState, useEffect } from 'react';



function Home() {
    const [events, setEvents] = useState([])


    useEffect(() => {
        fetch('/events')
        .then(r => r.json())
        .then(r => setEvents(r))
    }, [])

    const shows = events.map(show => {
        return(
        <EventCard key={show.id} {...show} />
        )
    });



    return (

        <div>
            <img source="public/pictures/RNI-Films-IMG-4CCAFE9E-3F30-4DFD-8C71-3D55E9D8410B.jpeg"/>
            {shows}
        </div>
    )




}

export default Home;
